from PIL import Image
import numpy as np
pixels = [255,0]
b = ""
d=[]
for i in range(0,len(b),200):
	d.append(list(b[i:i+200]))

for i in range(200):
	for j in range (200):
		if(d[i][j]=='0'):
			d[i][j] = pixels[1]
		else:
			d[i][j] = pixels[0]
			


array = np.array(d, dtype=np.uint8)
new_image = Image.fromarray(array)
new_image.save('flag.png')


